import Nav from 'react-bootstrap/Nav';
import '../css/Navbar.css';
import React, {Component} from 'react';
import pages from '../pages.json'


const _nav_items_right = [
    {title: "Logga in", id: "login"},
];

class Navbar extends Component {

    constructor(props){
        super(props);

        let handleClick = this.handleClick.bind(this, 'Parameter');
    }

    handleClick = (param) => (e) => {
        console.log('Event', e);
        console.log('Parameter', param);
    }


    render(){
        this.content_left = pages.map((item) => new NavItem(item.title, item.id));
        this.content_right = _nav_items_right.map((item) => new NavItem(item.title, item.id));

        return (
            <Nav className={"clearfix"}>
                <div className={"left"}>
                    {this.content_left}
                </div>

                <div className={"right"}>
                    {this.content_right}
                </div>
            </Nav>
        )
    }

}

function NavItem(title, id){
    return (
        <Nav.Item>
            <Nav.Link onSelect={this.handleClick('Parameter')} activeKey={id} href={"#"+id}> {title} </Nav.Link>
        </Nav.Item>
    )
}

export default Navbar
